CREATE DEFINER=`root`@`localhost` PROCEDURE `exportToCSV`()
BEGIN

	
    DECLARE finished INTEGER DEFAULT 0;
	DECLARE csv_path varchar(100) DEFAULT "";
    DECLARE check_employeeid tinyint;
    DECLARE check_SVNR tinyint;
    DECLARE check_first_name tinyint;
    DECLARE check_last_name tinyint;
    DECLARE check_login_name tinyint;
    DECLARE check_password tinyint;
    DECLARE check_start_date tinyint;
    DECLARE check_end_date tinyint;
    DECLARE department_id INTEGER;
    DECLARE last_synced datetime;
    DECLARE targetstateid INTEGER;


	-- declare cursor for targetconfig and targetstate
	DECLARE cur_list 
		CURSOR FOR 
			select 	tc.check_employeeid, 
					tc.check_SVNR, 
					tc.check_first_name, 
					tc.check_last_name, 
					tc.check_login_name, 
					tc.check_password, 
					tc.check_start_date, 
					tc.check_end_date,
					ts.department_id,
                    ts.last_synced,
					ts.path,
                    ts.targetstate_id
		from targetconfig tc
		INNER JOIN targetstate ts on tc.targetconfig_id = ts.targetconfig_id
		WHERE ts.active = 1 and ts.type = "CSV";

	-- declare NOT FOUND handler
	DECLARE CONTINUE HANDLER 
        FOR NOT FOUND SET finished = 1;

	OPEN cur_list;

	getCSVPath: LOOP
		FETCH cur_list 
			INTO 
				check_employeeid, 
                check_SVNR, 
                check_first_name, 
                check_last_name, 
                check_login_name, 
                check_password, 
                check_start_date, 
                check_end_date, 
                department_id,
                last_synced,
                csv_path,
                targetstateid;
		IF finished = 1 THEN 
			LEAVE getCSVPath;
		END IF;
        
		-- create temporary table with employee data
		DROP TEMPORARY TABLE IF EXISTS tmp_exportCSV; 
		CREATE TEMPORARY TABLE tmp_exportCSV 
					SELECT 
						CASE WHEN check_employeeid = 1 THEN IFNULL(e.employeeid,'') END as employeeid,
						CASE WHEN check_SVNR = 1 THEN IFNULL(e.SVNR,'') END as SVNR,
                        CASE WHEN check_first_name = 1 THEN IFNULL(e.first_name,'') END as first_name,
                        CASE WHEN check_last_name = 1 THEN IFNULL(e.last_name,'') END as last_name,
                        CASE WHEN check_login_name = 1 THEN IFNULL(e.login_name,'') END as login_name,
                        CASE WHEN check_password = 1 THEN IFNULL(e.password,'') END as password,
                        CASE WHEN check_start_date = 1 THEN IFNULL(e.start_date,'') END as start_date,
                        CASE WHEN check_end_date = 1 THEN IFNULL(e.end_date,'') END as end_date,
                        department_id
                        FROM employee e
            WHERE e.department_id = department_id and e.active = 1 and (last_synced < e.last_changed or last_synced is null)
            ORDER BY e.employeeid ASC;
            
		SET @DEPARTMENTID = department_id;
        SET @FOLDER = csv_path;
        SET @TIMESTAMP = DATE_FORMAT(NOW(), '%Y%m%d%H%i%s');
		SET @FULLPATH := CONCAT(@FOLDER, 'employees_',@DEPARTMENTID,'_',@TIMESTAMP,'_.csv');
		
        -- export to CSV
		SET @Q1 := CONCAT("SELECT * INTO OUTFILE '",@FULLPATH,
		"' FIELDS TERMINATED BY ';'
        OPTIONALLY ENCLOSED BY '\"'
		FROM tmp_exportCSV");

		IF (EXISTS (SELECT 1 FROM tmp_exportCSV)) THEN
        BEGIN
			PREPARE S1 FROM @Q1;
			EXECUTE S1;
			DEALLOCATE PREPARE S1;
            
            -- update sync-status if an export has been executed
            update targetstate set last_synced = DATE_FORMAT(NOW(), '%Y%m%d%H%i%s') where targetstate_id=targetstateid;
            
       END;     
       ELSE     
	   BEGIN
			-- update sync-status if no export has been executed
			update targetstate set last_synced = DATE_FORMAT(NOW(), '%Y%m%d%H%i%s') where targetstate_id=targetstateid;
       END;
         
	END IF;
        
	END LOOP getCSVPath;
    
	CLOSE cur_list;


END ;;
DELIMITER ;
